import axios from 'axios';
import React from 'react';

class App extends React.Component{

    constructor(props){
        super(props);
        this.state = {status : 0};
    }

    healthCheck() {
        axios
            .get("https://finalspaceapi.com/api/v0/character/?limit=2%22")
        //    .get("https://localhost:8000/")
            .then(response => this.state.status = response.status);

    }

    render(){
        return (
            <div className="App">
                <h2>Health Check</h2>
                <div id="status">{this.state.status}</div>
                <button onClick={this.healthCheck}>Test Backend</button>
            </div>
        );
    }
}


export default App;
